INSERT INTO `modx_site_content` (`id`, `type`, `pagetitle`, `longtitle`, `description`, `alias`, `link_attributes`, `published`, `pub_date`, `unpub_date`, `parent`, `isfolder`, `introtext`, `content`, `richtext`, `template`, `menuindex`, `searchable`, `cacheable`, `createdby`, `createdon`, `editedby`, `editedon`, `deleted`, `deletedon`, `deletedby`, `publishedon`, `publishedby`, `menutitle`, `donthit`, `privateweb`, `privatemgr`, `content_dispo`, `hidemenu`, `class_key`, `context_key`, `content_type`, `uri`, `uri_override`, `hide_children_in_tree`, `show_in_tree`, `properties`, `alias_visible`) VALUES (NULL,'document','Продукция и Цены','Вид, характеристики и стоимость вибропрессованных изделий Завода LATERES','Завод LATERES - широкий ассортимент строительных блоков, тротуарной плитки, бордюрного камня, а также облицовочного кирпича различных модификаций и размеров','products','',1,0,0,0,1,'строительные блоки, тротуарная плитка, изделия из бетона, бордюрный камень, облицовочный кирпич, вибропрессованные изделия','<p>Завод LATERES предлагает к продаже в широком ассортименте <strong>строительные блоки</strong>, <strong>тротуарная плитку</strong>, <strong>бордюрный камень</strong> и <strong>бордюр садовый тротуарный</strong>, а также <strong><a href=\"[[~36]]\">облицовочный кирпич</a></strong> различных модификаций и размеров. У нас каждый может найти именно то что требуется по наиболее выгодной цене. В зависимости от потребностей и технических требований к строению, тут можно выбрать именно тот вид блоков, который будет наиболее соответствовать техническим условиям.<br/><br/>\nАссортимент завода широко представлен в каждом из перечисленных направлений производства, с которым можно ознакомится и приобрести по месту нахождения Завода Вибропрессованных Изделий «LATERES» в Солнечногорске, но и на территории Подмосковья и Москвы, а также в Солнечногорском районе, Клинском районе и в городах Клин, Одинцово, Химки, Дмитров, АО Зеленоград:<br/>\n<strong><a href=\"[[~9]]\">Стеновые блоки</a></strong> – завод производит в полном ассортименте (рядовые блоки, стеновые блоки, перегородочные блоки,  фундаментные блоки) для Солнечногорска и Солнечногорского района, Москвы и Подмосковья, а также пустотелые блоки из керамзитобетона и пескобетона (керамзитобетонные блоки и пескоцементные блоки).<br/>\n<strong><a href=\"[[~16]]\">Тротуарная плитка от производителя</a></strong> – качественная тротуарная плитка брусчатка, изготовленная по современным технологиям, поможет провести отделку двора и придомовой территории.<br/>\n<strong><a href=\"[[~18]]\">Камень бордюрный</a></strong> – производится из качественных материалов и соответствует самому высокому стандарту.<br/>\n<strong><a href=\"[[~9]]\">Керамзитобетонные блоки</a></strong> различных модификаций – популярный и недорогой строительный материал, выдерживающий высокие нагрузки и не подверженный температурному воздействию. Кроме того, керамзитовые блоки сравнительно легкие, что позволяет использовать их если требуется уменьшить нагрузку при постройке.<br/>\n<strong><a href=\"[[~9]]\">Фундаментный блок</a></strong> – производство блоков для фундаментов, с повышенной устойчивостью к нагрузкам. Такие блоки – это залог надежного, крепкого и долговечного строения.<br/>\n<strong><a href=\"[[~36]]\">Фасадный кирпич</a></strong> – изготавливаем в ассортименте в Солнечногорске: <a href=\"[[~36]]\">лицевой кирпич</a>, а также <a href=\"[[~22]]\">облицовочный камень</a>. С его помощью можно придать новый стиль любому зданию или малой архитектурной форме.<br/><br/>\nМы предлагаем качественные изделия по наиболее выгодным ценам, поскольку у нас собственное производство, благодаря чему исключаются множественные посреднические наценки. Независимо от того, требуются ли бетонные блоки для строительства высоко нагруженных конструкций, или пескоцементные блоки для внутренних перегородок и конструкций не требующих повышенной прочности.<br/><br/>\n<a href=\"[[~9]]\">Блоки из керамзитобетона</a> – недорого и качественно<br/>\nВ последние несколько лет все более востребованными становятся керамзитобетонные блоки, цена которых немного выше, чем у бетонных, но при этом керамзитовый блок обладает меньшим весом и меньшим коэффициентом теплопроводности. На наших производственных мощностях можно изготовить керамзито-песчаные блоки с содержанием керамзита 30% или 90% (требования ГОСТ), поэтому каждый наш заказчик сможет найти тот керамзитовый блок, который оптимален для того или иного строительства. Мы предлагаем керамзитоблоки различных форм, которые могут использоваться и в качестве основы для строительства зданий и сооружений различного назначения.<br/>\nБетонные блоки для частного или промышленного строительства</p>',0,34,5,1,1,1,1480211808,1,1556082828,0,0,0,1480211280,1,'Продукция',0,0,0,0,0,'msCategory','web',1,'products/',0,0,1,'{\"core\":{\"viewtickets\":{\"104.35.18.134\":1542764793,\"141.8.142.52\":1521524987,\"216.244.66.230\":1665599784,\"178.154.171.17\":1521462217,\"87.249.21.20\":1521132580,\"46.229.168.71\":1519722827,\"75.36.81.43\":1525303944,\"5.9.32.222\":1645785132,\"77.37.171.145\":1519893155,\"86.62.95.230\":1519908080,\"217.182.194.69\":1520903642,\"46.242.72.2\":1519943409,\"66.249.75.215\":1519966019,\"107.77.230.64\":1520014469,\"95.73.6.254\":1520015727,\"134.249.144.34\":1521186889,\"2620:101:2002:11a4::100e\":1633206747,\"87.255.2.114\":1520067681,\"94.199.151.22\":1520092152,\"66.249.92.95\":1528688128,\"66.249.92.94\":1529674428,\"178.140.246.62\":1520148213,\"2a01:4f8:141:332a::2\":1583455581,\"66.249.76.97\":1531001561,\"89.188.124.238\":1557842289,\"31.173.84.20\":1523118712,\"2a03:2880:21:2fe6:face:b00c:0:8000\":1520287695,\"2a03:2880:2111:9fe9:face:b00c:0:8000\":1520315498,\"46.188.52.221\":1520333171,\"31.173.83.164\":1545148363,\"5.228.156.227\":1520346326,\"176.14.198.184\":1520359261,\"31.173.81.186\":1520507599,\"91.239.69.106\":1520518553,\"79.120.76.144\":1522512798,\"31.173.86.169\":1520618142,\"188.123.231.68\":1520623420,\"93.158.158.75\"