INSERT INTO `modx_site_content` (`id`, `type`, `pagetitle`, `longtitle`, `description`, `alias`, `link_attributes`, `published`, `pub_date`, `unpub_date`, `parent`, `isfolder`, `introtext`, `content`, `richtext`, `template`, `menuindex`, `searchable`, `cacheable`, `createdby`, `createdon`, `editedby`, `editedon`, `deleted`, `deletedon`, `deletedby`, `publishedon`, `publishedby`, `menutitle`, `donthit`, `privateweb`, `privatemgr`, `content_dispo`, `hidemenu`, `class_key`, `context_key`, `content_type`, `uri`, `uri_override`, `hide_children_in_tree`, `show_in_tree`, `properties`, `alias_visible`) VALUES (NULL,'document','Облицовочный камень / блок','Лицевой строительный блок - сразу готовые фасады зданий','Искусственный облицовочный каменный блок для облицовочных работ может вызвать только удивление','facing-stone-block','',1,0,0,9,1,'Облицовочный камень, Облицовочный блок ','<p>Сегодня стандартными для применения в малоэтажном строительстве являются два вида очень хорошего по качествам искусственного камня. Первый изготавливается на основе бетона методом вибропрессования, второй представляет собой гипсополимер. Гипсополимер  - мягкий материал, ему легко можно придать совершенно любую форму не только в процессе изготовления, но и во время строительства здания. Особенность его заключается в гидроактивности – он поглощает избыток влаги и выделяет ее в сухой среде. Такой камень подойдет для облицовки труднодоступных элементов декора в условиях мягкого климата или для внутренних работ. Однако из-за его мягкости, такой строительный материал запрещено применять в качестве элементов любых несущих конструкций.</p>\r\n<p>Бетонная основа камня намного прочнее и не изменяется до и после усадки. Поэтому для наведения внешнего лоска здания больше подходит бетонная облицовка. Новшество в производстве такого вида искусственного камня – использование кевларобетона, этот материал прочнее бетона, но при этом он очень легкий и морозостойкий. Отлично будет служить в северных районах и зонах повышенной влажности. Допускается применение такого камня для создания несущих элементов, особенно активно он применяется для создания заборов и ограждений вокруг приусадебных участков.</p>\r\n<p>В выборе облицовочного материала важную роль играет внешний вид и сроки сохранения цвета. В производстве любого вида искусственного камня очень широко используется две технологии окраски. Красители могут добавляться в массу самого раствора. Тогда камень будет прокрашен полностью, и в случае скола дефект не будет бросаться в глаза. При окраске только лицевой стороны любые поверхностные повреждения раскроют секрет искусственности материала. Внешняя окраска со временем выгорает, а структурированный цвет будет привлекательным и ярким до 25 лет, часто и дольше. Способ окраски можно заранее уточнить по специально разломанным образцам. При этом обратите своё внимание на то, насколько окраска искусственного камня напоминает  природный прототип. Чем разнообразнее будет расцветка, тем больше натуральности обретет поверхность.</p>',1,34,10,1,1,1,1480808106,1,1530320017,0,0,0,1480214760,1,'',0,0,0,0,0,'msCategory','web',1,'products/bloki/facing-stone-block/',0,0,1,'{\"core\":{\"viewtickets\":{\"141.8.142.52\":1521370196,\"216.244.66.230\":1663452843,\"5.9.32.222\":1645789647,\"217.182.194.69\":1520903792,\"84.52.65.176\":1519915353,\"104.35.18.134\":1520034453,\"178.154.171.17\":1521182617,\"94.199.151.22\":1520092286,\"2a01:4f8:141:332a::2\":1583455761,\"66.249.76.127\":1559513082,\"117.30.204.195\":1520624686,\"46.229.168.75\":1520674789,\"213.24.127.20\":1520710907,\"94.228.254.224\":1520764566,\"212.83.9.143\":1520770257,\"148.101.35.203\":1520826536,\"185.36.158.202\":1521122509,\"107.77.227.100\":1521150781,\"212.45.20.91\":1521173747,\"134.249.144.34\":1521186899,\"159.65.133.112\":1521420807,\"82.204.204.242\":1523253371,\"213.87.155.20\":1521481770,\"188.32.73.188\":1521506625,\"212.193.117.245\":1665578480,\"81.209.177.189\":1556635763,\"141.8.142.130\":1535603479,\"61.15