:1664268916,\"95.108.213.36\":1664377658,\"87.250.224.109\":1664376312,\"18.204.56.97\":1664405903,\"157.55.39.181\":1664849086,\"66.249.66.3\":1664471348,\"66.249.66.52\":1664473754,\"44.201.68.86\":1664512151,\"64.124.8.41\":1664599589,\"64.124.8.35\":1664630694,\"87.250.224.29\":1665625599,\"194.32.229.54\":1664681227,\"188.170.74.191\":1664693497,\"207.46.13.165\":1664724731,\"104.232.199.58\":1664905845,\"54.36.148.44\":1664920455,\"45.145.116.54\":1664949140,\"66.249.66.4\":1664972355,\"54.36.149.52\":1665144121,\"45.139.176.102\":1665183078,\"109.248.128.203\":1665186641,\"144.76.17.26\":1665268779,\"185.191.171.25\":1665276734,\"46.8.213.88\":1665295155,\"195.133.201.18\":1665328331,\"66.249.76.115\":1665389836,\"69.160.160.60\":1665530431,\"66.249.75.130\":1665620670,\"54.36.148.11\":1665758469,\"185.191.171.33\":1665881854,\"46.147.193.118\":1666009476,\"217.113.194.164\":1666023132,\"217.113.194.138\":1666024135,\"217.113.194.158\":1666024529}}}',1),(NULL,'document','Кирпич','Кирпич от LATERES - создавайте уникальные объекты по стандартной технологии!','Среди облицовочных материалов на рынке России продукция завода LATERES отличается красотой и долговечностью, широтой и оригинальностью ассортимента','brick','',1,0,0,5,1,'облицовочный кирпич, лицевой кирпич, кирпич, бетонный кирпич','<p>Среди <b>облицовочных материалов</b> на рынке России продукция завода LATERES отличается красотой и долговечностью, широтой и оригинальностью ассортимента.\n<br/>\nНаиболее широкое распространение получил <b>облицовочный кирпич в Солнечногорском районе</b>. Данный вид кирпича эстетически более привлекателен, чем строительный, применяется для внешней и внутренней облицовки стен и цоколей. Изобилие цветов, форм и фактур поверхности кирпича позволяет создавать уникальные архитектурные объекты.\n<br/>\n<b>Фасадный кирпич в Клину</b> применяется почти во всех сферах строительства из-за массы положительных качеств:\n<br/>\n- Внешний вид. <b>Облицовочный кирпич</b> сегодня является материалом, позволяющим архитекторам и дизайнерам создавать уникальные и наиболее эксклюзивные проекты, так как позволяет использовать огромное количество расцветок, форм и фактур;\n<br/>\n- Термостойкость. <b>Лицевой кирпич в Солнечногорске</b> выдерживает более 100 циклов попеременного замораживания и оттаивания.\n<br/>\n- Прочность. Данное свойство кирпича позволяет использовать его как защитный материал зданий и сооружений от разрушения и старения.<br/>\nСреди материалов, изготавливаемых заводом LATERES, стоит выделить также <b>бетонный кирпич в Зеленограде</b>. <b>Кирпич из бетона</b> является строительным материалом, широко использующимся при укладке фундаментов, цокольных стен, подвалов. Собственно, его можно применять и как фасадный (облицовочный) материал.<br/>\nВся продукция завода изготавливается по ГОСТу, что гарантирует его высокое качество. Таким образом, Вы можете быть уверены в том, что используете действительно экологичные, безопасные и надежные материалы.<br/>\nТакже мы можем похвастаться доступными ценами на продукцию LATERES, что делает её наиболее конкурентоспособной.<br/>\nОтметим, что к каждому заказу мы подходим индивидуально и рекомендуем именно тот товар, который поможет организовать любые ремонтные или строительные работы максимально выгодно и качественно.</p>',0,33,4,1,1,1,1492471629,1,1555978592,0,0,0,1480214760,1,'',0,0,0,0,0,'msCategory','web',1,'products/brick/',0,0,1,'{\"core\":{\"viewtickets\":{\"178.154.171.17\":1521198915,\"216.244.66.230\":1661742436,\"141.8.142.52\":1521462225,\"185.8.126.237\":1519829244,\"5.9.32.222\":1645789022,\"66.249.73.22\":1519857851,\"87.255.2.114\":1519884610,\"217.182.194.69\":1520903780,\"66.249.92.94\":1529206412,\"94.199.151.22\":1520092276,\"2a01:4f8:141:332a::2\":1583456039,\"66.249.76.97\":1531007652,\"89.188.124.238\":1520238535,\"117.30.204.195\":1520624685,\"176.59.42.185\":1520650121,\"213.59.174.35\":1520667623,\"90.154.65.17\":1520738424,\"94.228.254.224\":1520764475,\"212.83.9.143\":152