.48\":1664930876,\"66.249.66.50\":1664854038,\"157.55.39.181\":1664776962,\"44.201.68.86\":1664511160,\"87.250.224.29\":1665561155,\"135.181.180.59\":1664686005,\"207.46.13.165\":1665118358,\"85.249.32.189\":1664717077,\"157.55.39.26\":1665473601,\"66.249.66.52\":1664857299,\"95.163.255.173\":1665015461,\"40.77.167.16\":1665502181,\"54.36.148.46\":1665474843,\"40.77.167.80\":1665513503,\"66.249.75.135\":1665580973,\"66.249.75.158\":1665587698,\"54.36.148.26\":1665673219,\"95.108.213.9\":1665780707,\"5.45.207.138\":1665856524,\"185.191.171.2\":1665877091,\"185.191.171.6\":1665928486,\"217.113.194.157\":1666023618,\"217.113.194.151\":1666025064,\"217.113.194.143\":1666025646}}}',1),(NULL,'document','Брусчатка','Брусчатка тротуарная','Завод LATERES является одним из производителей вибропрессованной брусчатки. Звоните прямо сейчас и получите скидку','paving','',1,0,0,16,1,'Брусчатка','<p>В 1742 году в маленькой мастерской государства Дания провели первые успешные опыты по созданию особенно прочного кирпича для покрытия, который должен был заменить брусчатку на дорогах Европы. Ведь выпуск обычной брусчатки для мощения дорог был малоэффективным и дорогим, и найти замену ему пытались во многих странах. Так появился клинкерный кирпич или, как его называют по-другому, клинкер.</p>\r\n<p>С развитием современных технологий и методов производства на смену или точнее в дополнение к клинкерной Брусчатке стали производит данный вид тротуарной плитки методом вибропрессования. Завод LATERES является одним из производителей вибропрессованных изделий из бетона, который использует полностью отчественное оборудование и полный автоматизированный цикл производства.</p>\r\n<p>Такую брусчатку производят путем прессования полусухой цементной смеси на специальном станке, в котором давление на 1 кв. см. составляет более 5 000 кг. При высоком давлении минеральные частицы сливаются в монолит, и по прочности материал не уступает камню. Почти 1/3 часть готового материала составляет цемент Д 0 по ГОСТу ЦЕМ 1, остальная часть это отсев дробления натурального камня с фракцией 0 - 5 мм и крупный мытый песок крупинки до 2.2 мм, что позволяет не менять цвет под воздействием солнечных лучей и не боится влияния веществ, которые агрессивны. По механическим характеристикам брусчатка отличается тем, что в ней отсутствуют внутренние пустоты и включения, характерные для кирпича.</p>\r\n<p>Во многих городах Европы брусчаткой вымощены улицы и центральные площади. Сегодня брусчатка не имеет трещин, а ее цвет не изменился. Улицы с таким дорожным покрытием в настоящие дни являются местной достопримечательностью. Их охраняют как настоящие памятники архитектуры.</p>\r\n<p>На протяжении двух десятилетий брусчатка активно используется в странах СНГ и городах России. Изготавливать брусчатку начали смеси песка и цемента.</p>\r\n<p>При низких затратах на материал для изготовления брусчатки малозатратного технологического процесса прессования себестоимость продукта стала намного ниже. Снижение этого показателя привело к доступности данного строительного материала для всех, кто хочет заняться благоустройством на своем участке. Изделие иметь долгий срок службы - 10 лет.</p>\r\n<p>Смесь, которая применяется для изготовления плитки, отлично выдерживает агрессивные вещества. Тротуарная плитка очень медленно меняет цвет на солнце, и имеет отличные показатели гидрофобности при попадании влаги внутрь. Срок службы готового материала рассчитан на 10 лет. При низкой себестоимости затраты на монтаж тротуарной плитки сопостовимы с её стоимостью.</p>\r\n<p>На протяжении всего прошлого века производство этого материала продолжало развиваться. Были изобретены различные технологические процессы и оборудование, а также специальные добавки. Процесс вибропрессования брусчатки проводится с большим давление, что позволяет ей конкурировать с более дорогими аналогами - клинкерная плитка. Подготовленная брусчатка на специальных поддонах проходит длительную обработку паром, а затем остывая на специальных площадках до 7 дней. Эта технология стала прорывом в производстве брусчатки. Увеличилось количество, выбраковка свелась к нулю. Работает это оборудование без перерывов и постоянно, а отключается только для профилактических работ.</p>\r\n<p>В наши дни брусчатка применяется в декоре парковых площадок, пешеходных дорожек и различных зон отдыха. Распространена она в строительстве подъездных площадок к загородным домам, украшении лестниц и прочих архитектурных оформлениях. Различная световая гамма дает возможность подобрать брусчатку к любому фасаду и оформлению дома. Создание орнамента из различных цветов будет дополнительным оригинальным украшением.</p>\r\n<p>Для предотвращения зимнего скольжения в состав брусчатки добавляется крупнозернистый песок, вследствие чего лицевая сторона смотрится шероховатой и пористой. Это, кроме всего, предает дополнительную эстетику. Для придания благородного старинного вида дорожкам применяется многощелевой клинкерный кирпич. После его укладки щели заполняются песком, и вокруг высеваются различные виды трав и лишайников.</p>\r\n<p>Монтаж тротуарной плитки – относительно простой процесс. На городских улицах она укладывается на классическую дорожную основу. При загородном строительстве площадок брусчатка укладывается на уплотненный песок с посыпанной мелкозернистой щебенкой или на цементно-песчаную смесь. Если сделать поперечный профиль правильно и установить систему водостока, то на поверхности площадки из брусчатки не будет ни луж, ни грязи.</p>\r\n<p>На протяжении многих лет вибропрессованая брусчатка доказала, что он является универсальным и долговечным, и может быть применен в любых условиях. Декоративные свойства плитки доказаны тем, что им украшают центральные площади и территории вокруг богатых вил. Размер брусчатки представляет собой обыкновенный кирпич 10 на 20 см, а его превосходство доказывается многолетним использованием во многих странах мира.</p>',1,34,16,1,1,1,1525044588,1,1525046921,0,0,0,1525044540,1,'',0,0,0,0,0,'msCategory'