нотку старины. Однако процесс добычи природного камня и изготовления из него плитки мощения довольно трудоемкий и дорогостоящий, поэтому натуральная плитка применяется в ограниченных объемах и только для наиболее значимых объектов.</p>\r\n<p>Поэтому наиболее распространенным и экономически целесообразным материалом в наши дни является искусственная тротуарная плитка Старый Город, изготавливаемая из бетонных смесей с применением современных технологий. Основным методом изготовления тротуарной плитки Старый Город является метод полусухого вибропрессования бетонных смесей. Вибропрессование позволяет получать на выходе изделия с высокой механической прочностью, в том числе и прочностью на истирание вследствие получения однородного состава бетона. А максимальное удаление из бетона в ходе виброуплотнения свободного воздуха способствует наращиванию большей механической прочности и до минимума снижает гигроскопичность изделий.</p>\r\n<p>Тротуарные плитки Старый Город являются совершенно экологически чистыми изделиями, в связи с тем, что для их изготовления применяются только чистые природные материалы и компоненты - крупно и среднезернистый песок и цементы, а для получения плитки широкой цветовой гаммы используются минеральные красители. В ходе эксплуатации независимо от наружной температуры плитка не выделяет никаких вредных веществ, чего не скажешь про асфальтовые покрытия, выделяющие при высоких температурах битумные испарения.</p>\r\n<p>Наш Завод Вибропрессованных Изделий LATERES выпускает наиболее широкий и полный спектр тротуарных плиток Старый Город самых различных форм, размеров и цветов для их эффективного применения при осуществлении разнообразных дизайнерских, максимально эстетичных решений и только высокого качества. Высокое качество изделий обеспечивается строгим соблюдением требований стандартов на всех этапах производственной технологии и выражается в технических показателях по прочности на сжатие, истираемость, морозостойкости и водопоглощения. Маркировка тротуарной плитки Старый Город осуществляется с использованием буквенных обозначений.</p>\r\n<p>Завод Вибропрессованных Изделий LATERES приглашает потребителей к сотрудничеству.</p>',1,34,19,1,1,1,1525050634,1,1525051314,0,0,0,1525050600,1,'',0,0,0,0,0,'msCategory','web',1,'products/trotuarnaya-plitka/old-town/',0,0,1,'{\"core\":{\"viewtickets\":{\"69.75.107.131\":1570165857,\"141.8.142.130\":1534133059,\"66.249.76.126\":1663283047,\"94.25.171.85\":1525061967,\"95.108.213.30\":1534747336,\"40.77.167.201\":1525102493,\"95.163.107.70\":1525106190,\"195.211.115.5\":1525106694,\"95.163.107.74\":1525107310,\"104.35.18.134\":1541452428,\"40.77.167.50\":1525152692,\"207.46.13.75\":1525241743,\"51.15.35.25\":1525246386,\"128.214.224.188\":1525308842,\"5.9.32.222\":1645790813,\"157.55.39.146\":1525500415,\"178.140.202.126\":1525366484,\"109.63.240.6\":1525374478,\"66.249.73.22\":1525411077,\"37.16.82.27\":1525437712,\"66.249.76.127\":1663319063,\"83.220.237.139\":1525504806,\"83.220.238.34\":1525521793,\"54.36.148.187\":1620619006,\"72.14.199.120\":1525651164,\"195.128.94.84\":1525675621,\"66.249.89.150\":1542506604,\"95.25.21.230\":1525921456,\"79.111.246.89\":1525779076,\"83.217.199.174\":1525780408,\"93.191.21.163\":1525792289,\"87.250.224.213\":1525853952,\"85.26.233.179\":1526070109,\"95.213.183.162\":1525978813,\"34.204.60.65\":1525979972,\"46.38.44.87\":1526062021,\"94.25.168.141\":1526223317,\"54.36.149.59\":1555826857,\"176.59.36.74\":1526268497,\"85.30.254.37\":1526303607,\"93.179.75.24\":1526320367,\"91.231.233.187\":1623851263,\"212.193.117.245\":1665658604,\"89.207.90.2\":1526455300,\"148.251.223.21\":1595448828,\"5.3.145.246\":1526515139,\"31.148.139.15\":1526531262,\"94.25.169.137\":1526559717,\"87.255.31.36\":1526578304,\"213.87.137.255\":1526578959,\"2a00:1370:812d:232e:7d98:d841:993f:600f\":1526580047,\"107.77.229.214\":1526603838,\"46.39.34.63\":1526607980,\"93.158.158.76\":1531876251,\"104.155.59.234\":1526633580,\"185.13.112.129\":1526659273,\"66.249.79.35