529,\"217.113.194.162\":1666027228,\"217.113.194.176\":1666027498,\"217.113.194.191\":1666027513,\"217.113.194.153\":1666028285,\"217.113.194.134\":1666028002,\"217.113.194.181\":1666029834,\"217.113.194.140\":1666028033,\"217.113.194.189\":1666028300,\"217.113.194.132\":1666028472,\"217.113.194.146\":1666028740,\"217.113.194.128\":1666029546,\"217.113.194.152\":1666028992,\"217.113.194.136\":1666029198,\"217.113.194.147\":1666029213,\"217.113.194.187\":1666029229}}}',1),(NULL,'document','Цемент в мешках','Цемент в мешках от производителей','Большой выбор цемента от различных производителей и только свежий. Звоните +7 (903) 151-3344!','cement','',1,0,0,127,1,'Цемент','<p>Одним из самых популярных материалов, без которого не может обойтись абсолютно ни одно строительство, является цемент. Сфера его применения достаточно обширна - начиная от заливки фундамента, а заканчивая отделочными работами.</p>\n<p>Цемент - это сухая смесь, которая при контакте с водой обретает вязкость, превращаясь в субстанцию с высокой адгезионной способностью. После обратного высыхания материал застывает, обретая качества монолитного изделия.</p>\n<p>Стоит отметить, что определенные свойства цемента могут меняться. Это зависит от особенностей его производства, процентного соотношения составляющих и наличия различных добавок.</p>\n<p>Производство цемента может происходить по разным технологиям, но примерно по одинаковой схеме. Сначала получают клинкер путем обжига, измельчения и смешивания известняка с различными добавками. Затем материал измельчается, подсушивается. Потом снова смешиваются все составляющие, после чего происходит помол сырья.</p>\n<p>Цемент может быть нескольких видов. Это зависит от метода его производства, процентного соотношения добавок и их свойств. Наиболее распространены следующие виды данного материала:</p>\n<p>1. Быстротвердеющего типа. Такой вид цемента отличается наличием минеральных добавок, которые отвечают за активное затвердение на начальной стадии работы. Данный материал используется для производства железобетонных изделий, при скоростном строительстве.</p>\n<p>2. Гидрофобного типа. Характеризуется меньшим уровнем водопоглощения из-за гидрофобизирующих добавок. То есть в первое время после замешивания смесь не впитывает воду, поэтому после высыхания материал обладает высоким уровнем водонепроницаемости. Соответственно, подходит для применения на объектах с риском затопления или с близким расположением к воде.</p>\n<p>3. С активными добавками, которые вносятся на этапе помола смеси. От этого каждый элемент цемента покрывается специальным защитным слоем, который не позволяет сцепляться частицам состава. Такой способ дает возможность получить смесь с высоким значением подвижности, что используется при цементировании сложных архитектурных конструкций.</p>\n<p>4. Тампонажного типа. Это специфический вид цемента, который разработан специально для использования в нефтяной или газовой промышленности. Он применяется для бетонирования заколонного пространства в скважинах. Данный материал отличается высокой степенью текучести, повышенной прочностью даже на начальном этапе.</p>',1,34,8,1,1,1,1525118533,1,1551288742,0,0,0,1525118520,1,'',0,0,0,0,0,'msCategory','web',1,'products/building-materials/cement/',0,0,1,'{\"core\":{\"viewtickets\":{\"75.36.81.43\":1525120341,\"141.8.142.130\":1533356250,\"104.35.18.134\":1537768683,\"66.249.76.127\":1656744447,\"40.77.167.87\":1525143845,\"66.249.76.97\":1531014899,\"207.46.13.143\":1525150681,\"37.9.113.146\":1535401434,\"107.77.228.157\":1525194939,\"207.46.13.78\":1660850826,\"40.77.167.41\":1525241508,\"51.15.35.25\":1525246385,\"5.129.191.58\":1525250097,\"185.162.11.18\":1525252328,\"84.54.210.240\":1525255801,\"5.9.32.222\":1645789213,\"84.17.1.199\":1525337824,\"95.179.127.229\":1525346815,\"87.226.196.110\":1525350930,\"66.249.73.23\":1574931865,\"40.77.167.82\":1525410182,\"81.26.149.66\":1525428662,\"40.77.167.134\":1583765712,\"54.36.149.82\":1525565423,\"34.204.60.65\":1525980440,\