199.58\":1664905458,\"195.26.161.4\":1664963226,\"88.198.25.244\":1665049743,\"45.139.176.102\":1665058706,\"54.36.148.156\":1665117097,\"54.36.148.117\":1665146633,\"54.36.148.41\":1665149157,\"157.55.39.26\":1665275495,\"195.133.201.18\":1665328321,\"45.81.136.139\":1665329270,\"54.36.149.11\":1665432748,\"77.83.148.120\":1665483790,\"176.59.160.187\":1665570188,\"2a02:2168:8c31:3100::1000\":1665592979,\"51.255.126.236\":1665677107,\"95.108.213.9\":1666001648,\"172.121.216.131\":1665819569,\"217.113.194.169\":1666022471,\"217.113.194.142\":1666023352,\"217.113.194.160\":1666023712}}}',1),(NULL,'document','Инертные материалы','Сыпучие материалы - щебень, керамзит, песок, гравий, песчаные и щебёночные смеси','Сыпучие материалы - щебень, керамзит, песок, гравий, песчаные и щебёночные смеси','inert-materials','',1,0,0,127,1,'','<p>В строительстве используется огромное разнообразие сыпучих материалов, но наиболее востребованными среди них являются три основных: Песок; Щебень; Керамзит.</p>\r\n<p>Песок в огромном количестве встречается в дикой природе. В строительстве используют речной песок различных фракций (мелко-, средне- и крупнофракционный).</p>\r\n<p>Керамзит, наоборот, добывается искусственно в специальных плавильных печах и состоит из легкоплавкой глины. Щебень тоже не существует в естественной среде, его добывают путем дробления и последующей сортировки. </p>\r\n<p>Рассмотрим каждый из этих видов сыпучих материалов по отдельности.</p>\r\n<p><strong>Керамзит</strong></p>\r\n<p>Это довольно необычный материал из легкоплавкой глины, которая обжигается при температурах до 1000 градусов и в ходе этого процесса приобретает высокую прочность. Внешне он очень похож на гравий, особенно это касается зернистости и округлой формы керамзита. Технология изготовления имеет две особенности:</p>\r\n<p>Под действием высокой температуры происходит вздутие глины, обеспечивая пористость состава;</p>\r\n<p>Наружная сторона при этом постепенно сплавляется, защищая керамзит от негативного воздействия различных факторов окружающей среды.</p>\r\n<p>Обработка гранул в барабане-печи происходит в течение 45 минут, что гарантирует высокое качество обжига.</p>\r\n<p>Керамзит имеет плотность 200-400 кг/м3. Он делится на мелкофракционный (диаметр гранул 5-10 мм) и крупнофракционный (10-20 мм). Если размер гранул менее 5 мм, такой материал называют «керамзитным песком».</p>\r\n<p>Основными преимуществами материала являются:</p>\r\n<ol>\r\n<li>Высокая огнеупорность (до 1200 градусов);</li>\r\n<li>Хорошая морозоустойчивость (в среднем, 25 циклов замораживания и оттаивания);</li>\r\n<li>Умеренный коэффициент водопоглощения (от 8 до 20%);</li>\r\n<li>Экологичность материала;</li>\r\n<li>Химическая инертность (не вступает в реакции с большинством щелочей и кислот);</li>\r\n<li>Длительный эксплуатационный срок;</li>\r\n<li>Высокая прочность на сжатие;</li>\r\n<li>Доступная цена.</li>\r\n</ol>\r\n<p><strong>Щебень</strong></p>\r\n<p>Щебень представляет собой искусственно размельченный с помощью специальной дробилки гранит. Он также может похвастаться несколькими преимуществами:</p>\r\n<ol>\r\n<li>Повышенная прочность (делится на высокопрочный (марка прочности М1200-М1400), прочный (М800-М1200), средней прочности (М600-М800), низкой прочности (М300-М600), очень низкой прочности – М200).</li>\r\n<li>Отличная морозоустойчивость.</li>\r\n<li>Низкая радиоактивность;</li>\r\n<li>Экологичность;</li>\r\n<li>Высокая адгезия (показывает уровень сцепления битумных вяжущих с поверхностью щебня);</li>\r\n<li>Долговечность;</li>\r\n<li>Устойчивость к механическим повреждениям.</li>\r\n</ol>\r\n<p>Щебень может иметь истинную и насыпную плотности. Истинная обозначает неизменную физическую характеристику материала, насыпная – среднюю плотность в природном состоянии (с учетом пустот между гранулами).</p>\r\n<p>Зерновой состав и форма гранул – еще один важный показатель для щебня. Здесь подразумевается соотношение гранул игловой и пластичной (или «лещадной») форм. В зависимости от размеров частиц выделяют такие виды частиц: Кубовидные (15%); Улучшенные (15-25%); Обычные (25-35%, 35-50%).</p>\r\n<p>Опытные строители используют кубовидные гранулы, поскольку они являются наиболее прочными из всех видов и способны максимально плотно прилегать друг к другу, уменьшая объем пустот.</p>\r\n<p>Щебень также делится на несколько видов в зависимости от размеров фракций: 5-10 мм; 5-20 мм; 10-20 мм; 20-40 мм; 20-65 мм; 25-60 мм; 40-70 мм.</p>\r\n<p>Используется щебень практически везде: Создание железнодорожных насыпей; Ремонт трамвайных линий; Реставрация подушек автомобильных дорог; Закладка фундамента зданий.</p>\r\n<p><strong>Песок</strong></p>\r\n<p>Этот сыпучий материал может быть как натуральным, так и искусственным. Наиболее важным преимуществом данного материала является химическая инертность по отношению ко всем видам вяжущих веществ и воде.</p>\r\n<p>Песок образуется в результате эрозии твердых горных пород и состоит преимущественно из небольших частиц оксида кремния (SiO2). Горные и речные пески отлично подходят для изготовления бетонных смесей и для сооружения оснований и покрытий аэродромов и автострад.</p>\r\n<p>Учитывая то, что песчинки по размеру неодинаковы, различают песок нескольких фракций: Крупнофракционный; Среднефракционный; Мелкофракционный.</p>\r\n<p>Песок, имеющий диаметр гранул 2,5 мм, применяется для кирпичной кладки, а песок с гранулами диаметром 5 мм нашел себе применение в бутовой кладке и заделке стыков строений.</p>\r\n<p>Искусственный песок состоит из дробленого мрамора, гранита, шлака, известняка. Он применяется как декоративный материал при закладывании фактурного пласта наружных панелей, а также при отделке разнообразных предметов обихода.</p>\r\n<p>Песок, щебень и керамзит востребованы в строительстве в равной степени.</p>',1,34,9,1,1,1,1525120823,1,1525140644,0,0,0,1525120800,1,'',0,0,0,0,0,'msCategory','web',1,'products/building-materials/inert-materials/',0,0,1,'{\"core\":{\"viewtickets\":{\"75.36.81.43\":1525121