ext-align: center;\">бесплатно</td>\r\n</tr>\r\n<tr>\r\n<td><strong>0.2</strong></td>\r\n<td>Составление сметной документации.</td>\r\n<td style=\"text-align: center;\">бесплатно</td>\r\n</tr>\r\n<tr>\r\n<td><strong>0.3</strong></td>\r\n<td colspan=\"2\">Дизайн проекта мощения (с поштучным расчётом элементов) по желании заказчика.</td>\r\n<td style=\"text-align: center;\">бесплатно</td>\r\n</tr>\r\n<tr>\r\n<td><strong>0.4</strong></td>\r\n<td colspan=\"2\">Разметка участка на территории заказчика.</td>\r\n<td style=\"text-align: center;\">бесплатно</td>\r\n</tr>\r\n<tr style=\"background-color: #eaeaea;\"><th><strong>1</strong></th><th colspan=\"3\">Укладка плитки по готовому основанию</th></tr>\r\n<tr>\r\n<td><strong>1.1</strong></td>\r\n<td>Мощение прямолинейное простого рисунка на сухую смесь.</td>\r\n<td rowspan=\"2\">Изготовление выравнивающего слоя (5 см), прокладка геополотна, финишная разуклонка, непосредственно укладка, просыпка швов песком.<br /><strong>без учёта стоимости тротуарной плитки</strong></td>\r\n<td style=\"text-align: center;\">500 руб/м²</td>\r\n</tr>\r\n<tr>\r\n<td><strong>1.2</strong></td>\r\n<td>Мощение декоративное (фигурное, круговое). Микс из трёх и более расцветок.</td>\r\n<td style=\"text-align: center;\">750 руб/м²</td>\r\n</tr>\r\n<tr style=\"background-color: #eaeaea;\"><th><strong>2</strong></th><th colspan=\"3\">Изготовление основания для мощения</th></tr>\r\n<tr>\r\n<td><strong>2.1</strong></td>\r\n<td>Устройство песчано-щебеночного основания под тротуарные дорожки и площадки (пешеходная зона).</td>\r\n<td>Выемка грунта до 300 мм, формирование ложа котлована - планировка с разуклонкой, трамбовка виброплитами, песчаная подушка, прокладка геоткани, отсыпка гравийной подушки фракцией 5-20мм с послойной трамбовкой виброплитой.</td>\r\n<td style=\"text-align: center;\">650 руб/м²</td>\r\n</tr>\r\n<tr>\r\n<td><strong>2.2</strong></td>\r\n<td>Устройство бетонного основания стоянка автомобилей, отмостка вокруг дома.</td>\r\n<td>Выемка грунта до 300 мм, формирование ложа котлована - планировка с разуклонкой, плёнка, песок, щебень, армирование арматурой, опалубка, бетон.</td>\r\n<td style=\"text-align: center;\">850 руб/м²</td>\r\n</tr>\r\n<tr>\r\n<td><strong>2.3</strong></td>\r\n<td colspan=\"2\">Укрепление края мощения цементным раствором</td>\r\n<td style=\"text-align: center;\">150 руб/м.п.</td>\r\n</tr>\r\n<tr style=\"background-color: #eaeaea;\"><th><strong>3</strong></th><th colspan=\"3\">Установка бордюрного камня</th></tr>\r\n<tr>\r\n<td><strong>3.1</strong></td>\r\n<td>Установка садового бордюра на раствор снизу и по бокам.</td>\r\n<td>Изготовление основания и установка<br /><strong>без учёта стоимости бордюрного камня</strong></td>\r\n<td style=\"text-align: center;\">250 руб/м.п.</td>\r\n</tr>\r\n<tr>\r\n<td><strong>3.2</strong></td>\r\n<td>Установка дорожного бордюра на раствор снизу и по бокам.</td>\r\n<td>Изготовление основания и установка<br /><strong>без учёта стоимости бордюрного камня</strong></td>\r\n<td style=\"text-align: center;\">450 руб/м.п.</td>\r\n</tr>\r\n<tr>\r\n<td><strong>3.3</strong></td>\r\n<td>Изготовление скрытого бордюра литьевого армированного</td>\r\n<td>Изготовление основания и установка<br /><strong>без учёта стоимости бордюрного камня</strong></td>\r\n<td style=\"text-align: center;\">300 руб/м.п.</td>\r\n</tr>\r\n<tr style=\"background-color: #eaeaea;\"><th><strong>4</strong></th><th colspan=\"3\">Работы по устройству ливневой системы</th></tr>\r\n<tr>\r\n<td><strong>4.1</strong></td>\r\n<td>Установка ливневых лотков на раствор снизу</td>\r\n<td>Бетонное основание и разуклонка</td>\r\n<td style=\"text-align: center;\">400 руб/м.п.</td>\r\n</tr>\r\n<tr>\r\n<td><strong>4.2</strong></td>\r\n<td>Установка дождеприемника, пескоуловителя</td>\r\n<td>Бетонное основание и подключение</td>\r\n<td style=\"text-align: center;\">550 руб/шт.</td>\r\n</tr>\r\n<tr>\r\n<td><strong>4.3</strong></td>\r\n<td>Прокладка водоотводных и дренажных труб</td>\r\n<td>Траншея, подушка, гидравлический наклон, подключение, засыпка.</td>\r\n<td style=\"text-align: center;\">220 руб/м.п.</td>\r\n</tr>\r\n<tr>\r\n<td><strong>4.4</strong></td>\r\n<td>Изготовление водоприемного колодца</td>\r\n<td>V = до 2 м³</td>\r\n<td style=\"text-align: center;\">6600 руб/шт.</td>\r\n</tr>\r\n<tr>\r\n<td><strong>4.5</strong></td>\r\n<td>Подгонка канализационных люков по высоте</td>\r\n<td>Срезание/наращивание</td>\r\n<td style=\"text-align: center;\">2500 руб/шт.</td>\r\n</tr>\r\n<tr style=\"background-color: #eaeaea;\"><th><strong>5</strong></th><th colspan=\"3\">Дополнительные работы</th></tr>\r\n<tr>\r\n<td><strong>5.1</strong></td>\r\n<td>Демонтаж плитки, бетона и пр.</td>\r\n<td>Плитка, асфальт, бетон до 100мм.</td>\r\n<td style=\"text-align: center;\">от 300 руб/м²</td>\r\n</tr>\r\n<tr>\r\n<td><strong>5.2</strong></td>\r\n<td colspan=\"2\">Резка бетона, плитка, бордюра, асфальта</td>\r\n<td style=\"text-align: center;\">330 руб/м.п.</td>\r\n</tr>\r\n<tr>\r\n<td><strong>5.3</strong></td>\r\n<td>Такелажные работы</td>\r\n<td>Ручная разгрузка/погрузка, вынужденное ручное перемещение материалов на объекте на расстояния более 30м.</td>\r\n<td style=\"text-align: center;\">550 руб/м³(Т.)</td>\r\n</tr>\r\n<tr>\r\n<td><strong>5.4</strong></td>\r\n<td colspan=\"2\">Погрузка и вывоз мусора</td>\r\n<td style=\"text-align: center;\">от 400 руб/м³</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<h5>Подготовительные работы</h5>\r\n<p>От того, насколько грамотно и качественно выполнен этап подготовительных работ зависит, то как будет выглядеть брусчатка в конце работы и продолжительность срока ее эксплуатации. Самым оптимальным считается следующий порядок выполнения работ на этом этапе:</p>\r\n<ul>\r\n<li>Удалить верхний слой грунта (плодородный слой), если расположение грунтовых вод достаточной высоко, то произвести частичную засыпку смесью песка и щебня с промежуточным уплотнением.</li>\r\n<li>Уложить геотекстиль с небольшим выпуском материала.</li>\r\n<li>Насыпать десять, а лучше пятнадцать сантиметров гравия.</li>\r\n<li>Создать подушку из песка толщиной не меньше пяти сантиметров, но и не больше пятнадцати. Она увлажняется и трамбуется. При этом на один кубический метр должно расходоваться не меньше десяти литров воды.</li>\r\n<li>Уложить смесь, состоящую из цемента и песка (от 2 до 4 см).</li>\r\n</ul>\r\n<p>В соответствии с предназначением поверхности из брусчатки и вероятных нагрузок, которые могут быть оказаны на нее, состав компонентов может несколько меняться.</p>\r\n<h5>Каким образом происходит укладка брусчатки и другой тротуарной плитки</h5>\r\n<p>Специалисты, для выполнения этой работы применяются два способа: при одном в качестве основания используется бетон, а при другом — щебень.</p>\r\n<h5>Кладем тротуарную плитку на щебень</h5>\r\n<p>В этом варианте используется сухая смесь, в которой на одну часть цемента приходится шесть частей песка. Она высыпается на предварительно подготовленное основание, для которого используется щебень, насыпанный слоем, чья толщина может колебаться от ста до ста пятидесяти миллиметров. Для изготовления бордюров рекомендуется использование раствор на основе цемента марки не меньше М-100 или приобретать готовый бордюрный камень. С целью придания покрытию дополнительной жесткости, укладывается специальная армирующая сетка.</p>\r\n<p>Элементы тротуарной плитки укладываются так, чтобы между ними присутствовали швы. Их предназначением является компенсация возможных подвижек грунтов, связанных с сезонными колебаниями температуры.</p>\r\n<p>Технология укладки состоит из следующих этапов:</p>\r\n<ul>\r\n<li>Вначале производится подготовка площадки. О том, как это должно быть сделано можно посмотреть выше по тексту.</li>\r\n<li>Создается подстилка. На первый слой основания оказывается довольно большая нагрузка, поэтому для его создания лучше всего воспользоваться смесь щебня с гравием. При этом необходимо соблюдение минимального наклона к краям от середины. Рекомендованный угол — от полутора до двух градусов.</li>\r\n<li>Подготовленная площадка ограждается с помощью бетонного бордюра. Чтобы его изготовить, в грунте делается небольшая траншея, дно которой засыпается песком. Глубина этого углубления должна быть рассчитана так, чтобы высота изготовленного бордюра не была выше лицевой части плитки, а лучше, если он будет несколько ниже. Таким образом, обеспечивается сток воды после выпадения осадков. Затем между готовыми бордюрами следует натянуть шнур, в качестве ориентира при укладке элементов брусчатки.</li>\r\n<li>Подготовленная площадка засыпается следующим слоем толщиной порядка 30 мм. Для него используется крупнозернистый песок, имеющий фракцию не больше пяти миллиметров.</li>\r\n<li>Не допускается, чтобы толщина всего несущего слоя была меньше ста миллиметров. Для уплотнения песка используется трамбовка. Чтобы ее изготовить можно взять метровый обрезок бруса сечением 20 на 20 мм и прикрепить к нему поперечную палку.</li>\r\n<li>Начинать кладку брусчатки следует от бордюра. При укладке первого ряда в качестве ориентира пользуются натянутой бечевкой. Межплиточные швы необходимо заполнять с помощью песка, чтобы предотвратить сдвигание элементов.</li>\r\n</ul>\r\n<h5>Использование бетона в качестве основания для тротуарной плитки</h5>\r\n<p>Этот метод укладки используется в том случае, если планируется передвижение по брусчатке автомобилей. Кроме того, им пользуются, если укладка производится на очень слабые или заболоченные почвы. В этих случаях не обойтись без подготовки надежного бетонного основания. А потому к вышеназванным операциям добавляются новые пункты:</p>\r\n<ul>\r\n<li>Из досок (как обрезных, так и не обрезных) или фанерных листов изготавливается опалубка. Ее стенки закрепляются посредством кольев, которые вбиваются в грунт. Расстояние между ними не должно превышать одного метра.</li>\r\n<li>Внутрь опалубки засыпается сто миллиметровый слой щебня, имеющего средний размер. Его хорошо утрамбовывают.</li>\r\n<li>Заливается порядка тридцати сантиметров бетона, на предварительно уложенную армирующую сетку. Готовую площадку рекомендуется закрыть целлофановой пленкой во избежание образования трещин в процессе высыхания.</li>\r\n<li>Для полного затвердевания бетона понадобится не менее 28 дней. По истечении этого срока можно производить укладку брусчатки. Для заполнения швов должен использоваться цемент-песочный раствор. Чтобы избежать его вымывания, уложенную плитку промывают, используя лейку.</li>\r\n</ul>\r\n<h5>Особенности укладки вибропрессованной плитки</h5>\r\n<p>Рисунок для укладки брусчатки или другой тротуарной плитки выбирается хозяином. Очень часто они, не мудрствуя лукаво, используют рисунок под названием «елочка». Но возможны и любые другие варианты, благо разнообразие форм и цветовых гамм позволяют дать волю фантазии. При использовании разноцветной брусчатки в качестве затирки желательно воспользоваться специальной фугой, в составе которой помимо цемента также присутствуют и колерные добавки. Выравнивается уложенная поверхность посредством киянки, ударная часть которой изготовлена из резины.</p>\r\n<p>Рекомендуется на 1 м делать уклон от 5 до 15 мм. Новичку справиться с идеально ровной укладкой брусчатки — задача практически невыполнимая. А потому незначительный уклон приведет к образованию на дорожке луж.</p>\r\n<p>Усадка брусчатки на подкладку происходит благодаря легкому постукиванию резинового молотка. Для каждого ряда обязательна проверка уровнем, под который подгоняются все элементы. При использовании сухой смеси можно ограничиться заглублением кирпичика на один сантиметр. А если используется влажный вариант, то необходимо погружать его на глубину не менее 2-х см. Для облегчения процесса укладки можно уложить по краям профилированные трубы и натянуть между ними шнур.</p>\r\n<p>Уложенной брусчатке дают время устояться, после чего на нее высыпается сухая песочно-цементная смесь, которая выметается таким образом, чтобы произошло заполнение всех швов между отдельными элементами брусчатки. Однако нельзя допускать, чтобы смесь оставалась на поверхности дорожки, иначе она впоследствии очень сложно удаляется.</p>\r\n<p>Элементарное следование предложенной нами инструкции, если присутствуют желание и возможности, позволит практически любому выложить брусчатку на собственном участке своими руками.</p>',1,34,0,1,1,1,1525982281,1,1525985399,0,0,0,1525982280,1,'',0,0,0,0,0,'msCategory','web',1,'products/services/brick-paving/',0,0,1,'{\"core\":{\"viewtickets\":{\"104.35.18.134\":1526620779,\"34.204.60.65\":1525982708,\"141.8.142.130\":1533689317,\"66.249.76.126\":1569291170,\"31.130.148.14\":1526027973,\"95.73.6.87\":1526029661,\"66.249.76.127\":1569325583,\"92.100.28.49\":1526061732,\"40.77.167.211\":1526065818,\"66.249.76.97\":1531616024,\"185.3.35.33\":1526096471,\"128.71.164.218\":1526145391,\"95.108.213.30\":1535982623,\"54.36.148.174\":1526203906,\"91.230.25.106\":1541109342,\"5.188.204.213\":1532318590,\"85.30.254.37\":1526303625,\"93.179.75.24\":1526320252,\"92.53.90.33\":1526602622,\"163.172.205.95\":1589421967,\"212.129.3.60\":1587201860,\"194.186.207.104\":1526383430,\"88.200.221.195\":1526383768,\"94.158.81.237\":1526398740,\"95.26.78.223\":1526420148,\"37.54.206.236\":1526440441,\"176.59.34.151\":1526500997,\"83.220.237.118\":1526538106,\"107.77.229.214\":1526603837,\"77.88.46.153\":1564184811,\"104.155.59.234\":1526633850,\"95.24.28.230\":1526639817,\"69.30.213.138\":1526682285,\"46.105.124.55\":1530493900,\"173.198.43.196\":1527105828,\"128.72.42.196\":1526704463,\"213.87.137.247\":1526707375,\"94.253.122.190\":1526726002,\"188.32.245.82\":1526730158,\"69.75.107.131\":1557418284,\"213.87.130.154\":1526812740,\"2a02:2168:1600:ee00:ddbd:1be3:891:8205\":1526814843,\"193.93.192.183\":1526830205,\"176.36.21.189\":1545721581,\"109.73.2.37\":1526893526,\"95.27.129.137\":1526904746,\"176.59.109.118\":1526910940,\"46.188.59.122\":1526913680,\"2a00:1370:8114:4908:ddcb:e8c:bf3b:6400\":1526924087,\"54.36.149.30\":1627802865,\"212.119.192.227\":1526971427,\"37.110.