INSERT INTO `modx_site_content` (`id`, `type`, `pagetitle`, `longtitle`, `description`, `alias`, `link_attributes`, `published`, `pub_date`, `unpub_date`, `parent`, `isfolder`, `introtext`, `content`, `richtext`, `template`, `menuindex`, `searchable`, `cacheable`, `createdby`, `createdon`, `editedby`, `editedon`, `deleted`, `deletedon`, `deletedby`, `publishedon`, `publishedby`, `menutitle`, `donthit`, `privateweb`, `privatemgr`, `content_dispo`, `hidemenu`, `class_key`, `context_key`, `content_type`, `uri`, `uri_override`, `hide_children_in_tree`, `show_in_tree`, `properties`, `alias_visible`) VALUES (NULL,'document','Бордюр садовый','Бордюрный камень тротуарный','Бордюрный камень тротуарный для садовых дорожек различных цветов. Звоните +7 (903) 151-3344','border-garden','',1,0,0,18,1,'Бордюр садовый, Бордюрный камень тротуарный, Бордюр тротуарный, Бордюр для садовых дорожек ','<p>Садовые бордюры являются железобетонными изделиями различных профилей и размеров, которые широко и повсеместно применяются при обустройстве дорожек, площадок и участков территорий.</p>\n<p>Использование</p>\n<p>Применение садовых бордюров позволяет кардинально изменить любой придомовой или примыкающий садовый участок, в результате которого они приобретают эстетичный и завершенный вид. Важную роль такие бордюры тротуарные играют в организации ландшафтного дизайна, и их применение позволяют сделать любой уголок сада или городского парка наиболее уютным местом отдыха.</p>\n<p>Для придания большей эстетичности ландшафтному дизайну бордюрные камни выпускаются не только привычного серого цвета, но красно-коричневого оттенка. Но садовые бордюры играют не только эстетическую роль в оформлении дорожек и участков, но и роль ограждающих конструкций, защищающих их покрытия от расползания и разрушения, а также от разрушения дождевыми и талыми водами.</p>\n<p>Изготовление</p>\n<p>Производство садовых бордюров нашей компанией осуществляется на вибропрессах. Применение такой современной технологии позволяет получать продукцию с прочностью, соответствующей требованиям ГОСТов и Технических условий и с высокой стойкостью к неблагоприятным природным воздействиям. При изготовлении садовых бордюров используются металлические формы (матрицы), которые способствуют получению поверхности бордюров максимально точной геометрии и ровной.</p>\n<p>Маркировка</p>\n<p>Маркировка садовых бордюров производится по единой для любых бордюров системе и заключается в сочетании буквенных БР - сокращенное их название и цифровых символов, которые означают также размеры в сантиметрах по длине, высоте и толщине:</p>\n<p>БР 80-30-15-3 поворотный с размерами по длине 80 см, высоте - 30 и толщине - 15 см, весом 85 кг;</p>\n<p>БР 80-20-8 с размерами аналогично - 80, 20 и 8 см, весом 26 кг;</p>\n<p>БР 50-20-8 с размерами соответственно 50, 20 и 8 см, весом 20 кг.</p>\n<p>БР 40-20-5 с размерами соответственно 40, 20 и 5 см, весом 7 кг.</p>\n<p>Характеристики</p>\n<p>Класс прочности на сжатие составляет не менее В25, истираемость менее 0,4 г/кв.см, морозостойкость не менее 200 циклов замораживания и оттаивания.</p>',1,34,4,1,1,1,1526272832,1,1627425795,0,0,0,1526272800,1,'',0,0,0,0,0,'msCategory','web',1,'products/bordyurnyij-kamen/border-garden/',0,0,1,'{\"core\":{\"viewtickets\":{\"104.35.18.134\":1537768594,\"141.8.142.130\":1536256810,\"188.64.169.53\":1526277159,\"66.249.76.97\":1529586789,\"93.191.21.163\":1526301427,\"66.249.76.127\":1566595338,\"69.75.107.131\":1564073772,\"66.249.69.57\":1526399233,\"40.77.167.146\":1526460864,\"176.59.34.151\":1526500443,\"2a00:1370:812d:232e:7d98:d841:993f:600f\":1526581527,\"95.108.213.30\":1535982673,\"93.158.158.76\":1526620769,\"104.155.59.234\":1526633569,\"37.112.41.248\":1526649078,\"72.14.199.160\":1526658133,\"72.14.199.164\":1526658283,\"69.30.213.138\":1526682214,\"93.158.156.97\":1557439691,\"173.198.43.196\":1526690437,\"188.32.227.97\":1526755873,\"46.138.22.45\":1526762695,\"109.197.31.137\":1526795162,\"54.36.149.52\":1654892153,\"80.243.13