t','Квадрат 400','Производство и продажа тротуарной плитки Квадрат 400','Производство и продажа тротуарной плитки Квадрат 400 ( 390×390×70 мм ). Звоните прямо сейчас: +7 (903) 151-3344','square-400','',1,0,0,16,1,'брусчатка квадратная, квадрат 400','<p>Квадратная тротуарная плитка 400×400×70  (более точный размер 390×390×70 мм), как и любой вид тротуарных плиток, представляет собой изделия для декоративного покрытия, при выполнении благоустройства участков различных территорий и элементов городской инфраструктуры.</p>\r\n<p>Использование плитки Квадрат 400</p>\r\n<p>Квадратная тротуарная плитка используется при устройстве тротуаров, различных пешеходных дорожек, обустройства в городских парках и скверах зон отдыха, а также при завершении отделки подземных переходов, площадок и площадей, стоянок общественного транспорта и во многих других местах. Особо необходимо отметить широкое применение тратуарных плиток с размерами 400×400×70 мм для устройства тротуарных дорожек в городах.</p>\r\n<p>Применение такой тротуарной плитки полностью имитирует укладку дорогостоящей натурального гранитного камня большого размера, а комбинированная укладка плитки различной цветовой гаммы придает необычную эстетичность. Тротуарная плитка обладает рядом преимуществ перед другими аналогичными материалами, в том числе высокой экологической чистотой из-за применения для ее изготовления чистых природных материалов. Кроме того плитка обладает достаточной долговечностью со сроком службы не менее 10 лет, высокой ремонтной пригодностью и простотой ухода.</p>\r\n<p>Изготовление</p>\r\n<p>Тротуарная плитка Квадрат 400 изготавливается на том же оборудовании и по той же технологии, что и других видов плиток, с применением методов вибро-прессования. Для повышения механической прочности плиток и улучшения их декоративных свойств в приготовленную смесь вводятся определенные добавки и минеральные красители (цветовые пигменты).</p>\r\n<p>Завод Вибропрессованных изделий компании LATERES, производящий изделия из бетона постоянно внедряются в производство новые методы и более улучшенные формулы добавок, при которых на полусухую растворную смесь в матрице пуансон оказывается мощное давление до ее твердения, позволяя использовать изделие на следующий день.</p>\r\n<p>Маркировка</p>\r\n<p>Маркировка квадратных тротуарных плиток производится по аналогичной системе, а именно с обозначением буквой К, что означает квадрат. Например обозначение 4К-7 указывает на форму плитки (квадратная), 4 - ширина и длина по 40 см, 7 - ее толщина, важный показатель характеризующий механическую прочность изделия и покрытия в целом, у других производителей подобных изделий могут быть и иная маркировка.</p>\r\n<p>Характеристики</p>\r\n<p>Компанией выпускаются квадратные плитки с размером 390×390×70 мм, весом 21 кг при обеспечении высоких технических характеристик по прочности и морозостойкости.</p>',1,34,20,1,1,1,1527925054,1,1558496116,0,0,0,1527925020,1,'',0,0,0,0,0,'msCategory','web',1,'products/trotuarnaya-plitka/square-400/',0,0,1,'{\"core\":{\"viewtickets\":{\"104.35.18.134\":1537768542,\"141.8.142.130\":1533382427,\"66.249.76.97\":1529564221,\"89.175.89.198\":1527935448,\"40.77.167.201\":1527949014,\"195.9.25.218\":1528709192,\"146.120.96.134\":1527974043,\"69.75.107.131\":1533421126,\"66.249.69.183\":1528073720,\"178.140.93.246\":1528142011,\"54.36.148.17\":1528145928,\"85.30.233.199\":1528893746,\"95.108.213.30\":1535018054,\"109.252.58.103\":1528205984,\"128.68.172.156\":1528220166,\"213.87.149.232\":1528398183,\"54.89.25.244\":1528231827,\"66.249.76.126\":1569315500,\"66.249.92.64\":1528299073,\"66.249.92.94\":1528299248,\"216.244.66.230\":1663284586,\"109.252.93.162\":1528361947,\"176.59.40.21\":1528433355,\"31.173.84.69\":1528433428,\"81.5.120.226\":1528438839,\"46.242.10.134\":1528525621,\"188.126.45.65\":1528529770,\"87.255.31.131\":1528538059,\"188.64.169.53\":1528692313,\"31.173.82.60\":1528707475,\"212.42.63.154\":1528722449,\"54.36.149.106\":1635092860,\"37.9.113.146\":15289034