32,\"87.250.224.29\":1665644364,\"66.249.66.4\":1664499103,\"44.201.68.86\":1664512103,\"54.36.148.245\":1664850590,\"66.249.66.144\":1664857982,\"66.249.66.83\":1664852814,\"66.249.66.78\":1664853418,\"178.176.73.226\":1664865752,\"5.255.253.90\":1665019824,\"83.220.237.35\":1665045019,\"66.249.68.70\":1665074892,\"185.191.171.14\":1665243615,\"194.32.229.22\":1665288261,\"195.133.201.18\":1665328330,\"54.36.148.182\":1665507500,\"69.160.160.60\":1665530418,\"45.134.180.182\":1665608160,\"77.37.243.229\":1665683079,\"217.113.194.157\":1666024357,\"217.113.194.162\":1666025947,\"217.113.194.183\":1666026166}}}',1),(NULL,'document','Керамзитобетонные блоки','Производство и продажа керамзитобетонных блоков','Керамзитобетонные блоки в широком ассортименте от Завода LATERES. Доставка манипулятором и Самовывоз','lightweight-aggregate-blocks','',1,0,0,9,1,'Керамзитобетонные блоки, керамзитовые блоки, блоки из керамзита','<p>«LATERES» Завод вибропрессованных изделий производит керамзитобетонные блоки в широком ассортименте, выпуская следующие основные виды изделий различных габаритных параметров:<br />• полнотелые блоки;<br />• блоки двухпустотные; <br />• блоки трехпустотные;<br />• блоки четырехпустотные;<br />• блоки семипустотные.</p>\r\n<p>Керамзитобетонные блоки изготавливаются на оборудовании марки завода «Стройтехника» РОССИЯ по фирменной технологии производителя, что позволяет осуществлять выпуск в промышленных объемах. Современные технологии обеспечивают возможность создания изделий, обладающих полным спектром всех необходимых функциональных свойств. Не менее важным аспектом является качественное исходное сырье. Для производства керамзитобетонных блоков используются, в частности, бездобавочный портландцемент Д0, очищенный песок и керамзитный гравий фр 5 - 10 мм однородной структуры.</p>\r\n<p>Особенности технологии и преимущества</p>\r\n<p>Керамзитобетонные блоки производятся способом объемного вибропрессования. Для изготовления применяют гранулы керамзита, полученные путем обжига из специальной глины. Использование качественного сырья и современных высокотехнологичных линий позволяет создавать изделия, отвечающие всем требованиям как общеевропейских стандартов, так и отечественного ГОСТ 6133-99.</p>\r\n<p>Керамзитные блоки обладают функциональными характеристиками, обуславливающими множество неоспоримых достоинств перед кирпичом, как керамическим, так и силикатным.</p>\r\n<p>Основными преимуществами являются:</p>\r\n<ul>\r\n<li>небольшая удельная масса, позволяет минимизировать нагрузку на фундамент – возводимая из керамзитобетонных блоков кладка более чем вдвое легче кирпичной;</li>\r\n<li>наличие пористой структуры, благодаря которой обеспечивается не только легкость, но и высокие тепло-звукоизоляционные показатели – использовать керамзитобетонные блоки можно в условиях сурового климата и повышенной шумности;</li>\r\n<li>объем каждого из стеновых керамзитобетонных блоков в 7 раз превосходит аналогичный показатель силикатного кирпича, что экономически выгодно, так как ускоряет возведение кладки.</li>\r\n</ul>\r\n<p>Применение керамзита способствует эффективному решению сразу нескольких задач. Пустоты минимизируют вес блоков, а естественные звукоизоляционные и теплоизоляционные свойства керамзита в полной мере передаются строительному материалу в целом, а значит, и непосредственно возводимым объектам.</p>\r\n<p>Выпускаемые нами керамзитоблоки безопасны в экологическом плане, прочны, надежны, долговечны, не боятся высоких и низких температур, целиком оправдывая себя экономически на всех этапах строительства и эксплуатации объектов.</p>\r\n<p>Заказать необходимые объемы продукции, получить информационную и консультационную поддержку вы можете по телефонам: +7 (903) 151-3344 </p>',1,34,9,1,1,1,1530317222,1,1530739260,0,0,0,1530317220,1,'',0,0,0,0,0,'msCategory','web',1,'products/bloki/lightweight-aggregate-blocks/',0,0,1,'{\"core\":{\"viewtickets\":{\"69.75.107.131\":1540934970,\"141.8.142.130\":1533333545,\"66.249.65.158\":1