.63.215\":1664269497,\"46.8.155.155\":1664280469,\"46.8.157.199\":1664292651,\"87.250.224.109\":1664329375,\"5.255.231.134\":1664418697,\"18.204.56.97\":1664408177,\"109.248.128.17\":1664408234,\"44.201.68.86\":1664510167,\"46.8.155.104\":1664590122,\"95.182.126.203\":1664650619,\"40.77.167.80\":1664695993,\"176.59.174.52\":1664753525,\"87.250.224.29\":1665614361,\"193.58.168.109\":1664814808,\"104.168.40.7\":1664905859,\"104.232.39.151\":1664905864,\"66.249.66.14\":1664917280,\"185.191.171.35\":1664950196,\"44.192.26.60\":1664958055,\"54.36.148.83\":1664967866,\"54.36.148.149\":1665113220,\"54.36.148.47\":1665155710,\"54.36.148.228\":1665156874,\"195.133.201.18\":1665328339,\"207.46.13.165\":1665366657,\"66.249.76.115\":1665386902,\"54.36.149.107\":1665411280,\"66.249.75.135\":1665626572,\"66.249.75.130\":1665627785,\"46.8.21.193\":1665691177,\"5.45.207.138\":1665697081,\"54.36.149.62\":1665707585,\"95.108.213.9\":1666052748,\"81.22.44.140\":1665961094,\"54.36.148.230\":1666003155,\"217.113.194.170\":1666023851,\"217.113.194.141\":1666025410,\"217.113.194.137\":1666025425}}}',1),(NULL,'document','Бетонные блоки','Бетонные блоки - прочные, огнестойкие и выдерживают большую нагрузку','Бетонные блоки различаются по своей форме, структуре и цвету. Выполнение индивидуальных заказов','concrete-blocks','',1,0,0,9,1,'бетонные блоки,  блоки из бетона,  пескоцементные блоки','<p>Стены дома, выложенные из таких блоков, прочные, огнестойкие и выдерживают нагрузку, которая в несколько раз превышают допустимую для стен с деревянным каркасом, норму. Бетонные стены крепятся к фундаменту с помощью бетона и стальной арматуры. Такие стены будут противостоять любому урагану.</p>\r\n<p>Бетон имеет много достоинств. Он не гниет, не горит, не боится грызунов и термитов, не ржавеет. Кроме того, он прекрасный звукоизолятор.</p>\r\n<p>Виды блоков</p>\r\n<p>Бетонные блоки различаются по своей форме, структуре и цвету. Блоки можно заказать, в соответствии с общим дизайном дома. Наружная отделка стен в таком доме, считается штукатурка на основе портланд-цемента. Пескоцементные блоки со скальной фактурой имеют грубую поверхность со следами обработки. Стандартный бетонный блок можно облицевать кирпичом, камнем или волокнистой асбоцементной обшивкой.</p>\r\n<p>Установка</p>\r\n<p>Между&nbsp;пескоцементными&nbsp;блоками и кирпичом оставляют воздушный зазор. В этом промежутке вода, просачивается снаружи, конденсируется, стекает вниз и уходит от самой стены. Вместо стены с полостью, можно выложить стену из бетонных блоков толщиной в 20 или 25 см. Пустоты заполняются гранулированным теплоизоляционным материалом. Если нужна дополнительная прочность, во внутренние блочные пустоты вставляют арматурные стержни и заливают бетоном. Можно построить двухэтажный дом на основе каркаса из стальных балок. Сам каркас позволяет сочетать преимущества бетонной кладки и прочного каркаса, исполненного на самом современном инженерном уровне. В качестве гранулированного термоизоляционного материала, используются пемза, расщепленная слюда или пенополистирол. Бетонную стену можно утеплить, сделав на внутренней поверхности обрешетку из деревянных планок. В промежутки вставляют жесткую панельную термоизоляцию и на получившуюся поверхность, наложив гипсовые стеновые плиты. Таким способом, можно облицевать и внутренние стены. Тут возможна обшивка не только гипсовыми стеновыми плитами, но и древесноволокнистыми, а также панелями из дерева и фанеры.</p>\r\n<p>Крыша в доме из бетона</p>\r\n<p>Принцип установки крыши такой же, как и в деревянных домах. Верхний опорный брус, крепится непосредственно к стене, а стропила на него, укладываются обычным способом.</p>\r\n<p>Монолитный бетон</p>\r\n<p>Технически правильно построенный бетонный дом, эффективно сберегает энергию. Стены в таких домах, в силу своей массивности,аккумулируют тепло и холод для внутренних помещений, это позволит экономить на затратах по отоплению или охлаждению жилья.</p>',1,34,8,1,1,1,1530318444,1,1610543821,0,0,0,15303184