личии на складе и с доставкой до места','vibro-bricks','',1,0,0,36,1,'вибропрессованный кирпич','<p>Самые привычные цвета кирпичей - это красный и белый. Разные составляющие, из которых изготавливаются данные строительные материалы, и определяют их цвет. Красный (керамический) кирпич состоит большей частью из глины, в состав вибропрессованного кирпича входят цемент, песок и большое количество иных материалов (Известняк-ракушечник; Отсев от производства щебня; Мрамор, мергель; Бой при производстве керамического кирпича; Доменные шлаки). Уплотненная полусухая смесь песка, цемента и других компонентов методом вибропрессования получила название вибропрессованные изделия из бетона. Соответственно, кирпич, состоящий из подобной смеси, называется вибропрессованным кирпичом. Современные производители изготавливают кирпич различных цветов и оттенков (красный, коричневый, черный и другие цвета). Легко можно получить любую окраску данного материала из всей цветовой палитры.</p>\r\n<p>Технология производства</p>\r\n<p>Производят вибропрессованный кирпич способом вибропрессования в матрице полусухой бетонной смеси. Смесь, состоящую из различных частей и добавок-модификаторов, прессуют для создания формы. Потом созданные заготовки обрабатываются водяным паром под давлением. Цветным кирпич станет, если в смесь добавить красящие пигменты. Применяются органические, придающие более яркий цвет, и минеральные красители.</p>\r\n<p>Окрашивание бывает объемным и поверхностным. Во время объемного окрашивания соответствующие пигменты вводятся в состав смеси. Большое количество красителя уменьшает механическую стойкость кирпича, увеличивая его стоимость. При поверхностном окрашивании уже готовый кирпич обрабатывается специальными пропитками или красками. Толщина внешнего слоя окрашивания составляет приблизительно 3 мм. Производители красителей гарантируют сохранность цвета в течение 30 лет.</p>\r\n<p>Основные характеристики</p>\r\n<p>Основные характеристики подобного кирпича сохраняются и в его цветном варианте. Прочность материала маркируется буквой М, а следующие за ней цифры обозначают допустимую нагрузку.</p>\r\n<p>Морозостойкость обозначена буквой F, цифры показывают, какое количество зимних холодных циклов выдерживает материал. Чем выше данный цифровой показатель, тем дольше будет служить кирпич.</p>\r\n<p>От плотности данного материала зависит качество теплопроводности и звукоизоляции. Измеряется плотность в кг/куб. м (у силикатного кирпича ее диапазон составляет 1300-2100). Чем выше плотность, тем быстрее на холоде промерзает кирпич.</p>\r\n<p>Вибропрессованный кирпич имеет не очень высокий уровень жаростойкости (до 550 градусов).</p>\r\n<p>Области применения</p>\r\n<p>Популярность цветного вибропрессованного кирпича обусловлена его многочисленными достоинствами: прочностью, огнеупорностью, хорошей шумоизоляцией, экологичностью.</p>\r\n<p>Данный материал применяется для облицовки фасадов, возведения как наружных стен, так и внутренних.</p>\r\n<p>Разноцветные дома вносят яркие свежие ноты в облик города или любой местности, где они возведены. С помощью цветного кирпича можно украшать стены декоративными рисунками и узорами.</p>\r\n<p>Из кирпича нельзя возводить фундаменты, строить печи и трубы, а также дымоходы. Он не используется при строительстве горячих производственных цехов и бань.</p>\r\n<p>Цветной вибропрессованный кирпич предоставляет новые возможности в отделке и декорировании зданий.</p>',1,34,3,1,1,1,1531538139,1,1531539311,0,0,0,1531538160,1,'',0,0,0,0,0,'msCategory','web',1,'products/brick/vibro-bricks/',0,0,1,'{\"core\":{\"viewtickets\":{\"166.148.126.160\":1531539883,\"141.8.142.130\":1534659775,\"66.249.76.127\":1653514931,\"176.208.15.246\":1531547904,\"5.35.78.115\":1531591674,\"66.249.76.126\":1664299720,\"5.200.52.153\":1531595289,\"138.197.73.210\":1531622694,\"178.140.93.246\":1531639726,\"95.158.230.17\":1531678994,\"5.137.172.182\":1531745356,\"95.108.213.30\":1536256811,\"194.177.14.190\":1531815996,\"216.244.66.230\":16