,\"213.87.159.54\":1663396530,\"188.187.69.189\":1663469042,\"2a01:4f9:6a:14d1::2\":1663560657,\"66.249.75.158\":1664597743,\"66.249.66.4\":1663863683,\"88.198.41.229\":1663597005,\"65.108.76.15\":1663608985,\"5.255.231.207\":1664003548,\"5.45.207.113\":1663784276,\"114.119.137.142\":1663793714,\"66.249.66.52\":1664467738,\"66.249.66.48\":1663931050,\"44.200.136.171\":1664131138,\"45.139.176.102\":1664166627,\"5.161.133.63\":1664177368,\"66.249.70.74\":1664268784,\"34.229.63.215\":1664269588,\"157.55.39.16\":1664266929,\"64.124.8.24\":1664290911,\"64.124.8.59\":1664298348,\"64.124.8.45\":1664304379,\"64.124.8.25\":1664310886,\"5.255.231.134\":1664381363,\"95.108.213.36\":1664376456,\"18.204.56.97\":1664405725,\"66.249.66.6\":1664853868,\"157.55.39.181\":1665171207,\"157.55.39.26\":1665273812,\"44.201.68.86\":1664512321,\"66.249.66.77\":1664854539,\"87.250.224.29\":1665493268,\"66.249.75.135\":1665629724,\"31.173.86.120\":1664642614,\"213.87.225.143\":1664778937,\"109.248.128.46\":1664794366,\"207.46.13.165\":1665137639,\"66.249.66.142\":1664844951,\"104.232.199.58\":1664905440,\"172.121.221.199\":1664905446,\"88.198.25.244\":1665049739,\"80.82.63.57\":1665099551,\"40.77.167.16\":1665131240,\"95.161.221.50\":1665153743,\"37.139.53.50\":1665189346,\"195.133.201.18\":1665328315,\"178.176.74.137\":1665399243,\"77.37.224.90\":1665600959,\"31.173.85.3\":1665650397,\"172.121.216.131\":1665819565,\"185.191.171.33\":1665832437,\"95.108.213.9\":1666001668,\"188.66.34.77\":1665956246,\"95.108.213.73\":1665997275,\"217.113.194.153\":1666022879,\"217.113.194.131\":1666023789,\"217.113.194.167\":1666024498}}}',1),(NULL,'document','Блоки для перегородок','Перегородочные блоки в строительстве','Перегородочные блоки в строительстве','blocks-for-partitions','',1,0,0,9,1,'Перегородочные блоки в строительстве','<p>Сегодня в строительной отрасли применяют множество конструкционных материалов. Это относится, в том числе, к изготовлению наружных стен, а также внутренних перегородок (межкомнатных перегородок). Строительные технологии развиваются быстрыми темпами, и ежегодно рынок предлагает новые инновационные материалы для ремонтных и строительных работ, но проверенные временем строительные блоки ничем не уступают им.</p>\r\n<p>К таким материалам относятся блоки для перегородок Завода LATERES.</p>\r\n<p>Перегородочные блоки из бетона или керамзита отлично подходят при монтаже стен и перегородок в офисных и общественных помещениях, многоквартирных домах, коттеджах, медицинских и образовательных учреждениях. Главным требованием применения подобных блоков является поддержание нормальной несущей способности основания. Если микроклимат помещения подразумевает повышенный уровень влажности воздуха, не возникает необходимость использования более влагостойких блоков.</p>\r\n<p>Изготавливают блок перегородочный методом вибропрессования, главная составляющая вяжущих составов - это цемент типа Д0 М500. Применяемые компоненты безвредны для здоровья ввиду низкой токсичности, они обладают огнеупорными свойствами. Использование в межкомнатных перегородках блоков способствует поддержанию комфортных микроклиматических условий помещения.</p>\r\n<p>Технологический процесс производства строительных блоков предусматривает получение продукции с прочностью М75, М100, М125, М150. Относительная легкость монтажа связана также с формой изделий – это параллелепипед, имеющий гладкую грань. Это особенность также увеличивает общую прочность конструкции.</p>\r\n<p>Используют бетонные перегородочные блоки такого типа для возведения перегородок, не выполняющих роль несущих. Конструкционный материал стоек к деформациям, вызываемым перепадом температур. Его ровная наружная поверхность дает возможность начать отделочные работы без каких-либо специальных подготовительных операций. Кроме того, блоки из керамзита выполняют роль шумоизоляционного покрытия, поглощая и рассеивая звуковые волны.</p>\r\n<p>Перечислим преимущества перегородочных блоков Завода LATERES, как строительного материала:</p>\r\n<p>· легкость монтажа и соединения элементов между собой. Для проведения работ не требуется проходить профессиональную подготовку;</p>\r\n<p>· блоки являются достаточно тонкими (мин 90 мм), не сильно уменьшают полезное пространство помещения, что немаловажно, если комната небольшая и каждый квадратный сантиметр на счету;</p>\r\n<p>· сохраняется необходимая жесткость за счет механических свойств материала;</p>\r\n<p>· затраты на ремонт снижаются, что наиболее актуально при больших площадях отделываемых поверхностей.</p>',0,38,11,1,1,1,1551888428,1,1651572875,0,0,0,1551888420,1,'',0,0,0,0,0,'msCategory','web',1,'products/bloki/blocks-for-partitions/',0,0,1,'{\"core\":{\"viewtickets\":{\"178.154.246.9\":1551898745,\"66.249.70.7\":1551943694,\"157.55.39.158\":1556229014,\"2a01:4f8:140:3158::2\":1567218308,\"2605:e000:9a06:c500:5c:185:73e2:478f\":1552029797,\"207.46.13.221\":1552066631,\"37.9.113.17\":1557481880,\"54.36.150.53\":1568298636,\"212.193.117.245\":1557392877,\"34.234.54.252\":1552315047,\"79.111.233.14\":1552465632,\"148.251.223.21\":1555288621,\"54.36.148.63\":1656616044,\"157.55.39.207\":1552895292,\"207.46.13.64\":1553285082,\"157.55.39.114\":1553327278,\"216.244.66.230\":1663452880,\"46.229.168.148\":1567760997,\"34.228.42.25\":1553473415,\"93.188.47.164\":1553591776,\"40.77.167.131\":1553656255,\"40.77.167.5\":1553715496,\"40.77.167.145\":1553882766,\"54.36.150.74\":1553919373,\"176.193.114.81\":1554022102,\"40.77.167.219\":1554329191,\"207.46.13.177\":1554445847,\"157.55.39.140\":1556644534,\"207.46.13.20\":1554488308,\"95.163.255.14\":1554510076,\"157.55.39.134\":1554552411,\"136.243.17.161\":1554621605,\"95.163.255.16\":1554646583,\"66.249.79.191\":1555450799,\"66.249.79.189\":1556436125,\"109.252.93.99\":1554915023,\"95.220.54.186\":1555182841,\"207.46.13.212\":1555271217,\"51.75.13.156\":1555297299,\"46.229.168.152\":1595066950,\"157.55.39.231\":1555571635,\"66.249.69.43\":1555792757,\"54.36.148.249\":1555812919,\"207.46.13.125\":1555889980