0,\"66.249.76.127\":1665369243,\"66.249.76.113\":1665388575,\"207.46.13.91\":1665612218,\"54.36.148.44\":1665528077,\"54.36.148.4\":1665573302,\"54.36.148.138\":1665698431,\"185.191.171.26\":1665932004,\"217.113.194.182\":1666023147,\"217.113.194.142\":1666024150,\"217.113.194.173\":1666024859}}}',1),(NULL,'document','Фундаментные блоки','Бетонный блок ФБС в загородном строительстве','Бетонный блок ФБС в загородном строительстве','foundation-blocks','',1,0,0,9,1,'Бетонный блок ФБС','<p>Бетонные блоки ФБС - это самый популярный и востребованный строительный материал на рынке строительных материалов. Это простой в изготовлении блок прямоугольной формы. Существует всего один способ изготовления качественных фундаментных блоков - это вибропрессование. Можно выделить следующие важнейшие свойства бетонного блока ФБС: легкость, простота в применении, немалая прочность блока М200 и конструкций из него, а также огнестойкость. Спектр применения бетонных блоков очень широк. Его применяют как в строительстве коттеджей, так и в строительстве различных помещений. Бетонные блоки намного выгоднее использовать в строительстве, нежели чем, к примеру, кирпич или прямую бетонную заливку стен.<br /><br /> \nВибропрессование – это процесс, вследствие которого уплотняется бетон. Сам процесс вибропрессования выглядит таким образом. В большую форму для прессования поступает бетонная смесь. Данная установка при действии вибраций продавливает и уплотняет смесь, тем самым приминая и сжимая его. В процессе уплотнения бетона лежит одна особенность, заключающаяся в том, что при вибропрессовании абсолютно все стенки емкости подвижны. Бетон в емкости подвергается механическому воздействию со всех сторон (даже сверху). Данный процесс производства фундаментных блоков, не однообразен. Это означает, что в процессе вибропрессования можно изменять силу механического воздействия на бетонную смесь в матрице, тем самым изготавливать бетон для различных сфер применения. Несомненно, при различных воздействиях на бетон меняется не только его структура, но и вес. Таким образом, можно посчитать, что для создания бетонного блока для строительства дома можно изготовить и использовать легкий блок, экономя при этом деньги.\n<br /> <br />\nДля любого бетонного фундаментного блока можно подобрать или изготовить абсолютно любую бетонную смесь. Все зависит от того, в какой сфере строительства будет применяться данный бетонный блок.</p>\n',0,38,11,1,1,1,1557446940,1,1651572893,0,0,0,1551888420,1,'',0,0,0,0,0,'msCategory','web',1,'products/bloki/foundation-blocks/',0,0,1,'{\"core\":{\"viewtickets\":{\"178.154.246.9\":1551898745,\"66.249.70.7\":1551943694,\"157.55.39.158\":1558794992,\"2a01:4f8:140:3158::2\":1567218312,\"2605:e000:9a06:c500:5c:185:73e2:478f\":1552029797,\"207.46.13.221\":1552066631,\"37.9.113.17\":1557715268,\"54.36.150.53\":1552233250,\"212.193.117.245\":1665578427,\"34.234.54.252\":1552315047,\"79.111.233.14\":1552465632,\"148.251.223.21\":1555288621,\"54.36.148.63\":1552793632,\"157.55.39.207\":1552895292,\"207.46.13.64\":1553285082,\"157.55.39.114\":1583324389,\"216.244.66.230\":1663131695,\"46.229.168.148\":1584355371,\"34.228.42.25\":1553473415,\"93.188.47.164\":1553591776,\"40.77.167.131\":1553656255,\"40.77.167.5\":1553715496,\"40.77.167.145\":1553882766,\"54.36.150.74\":1559036678,\"176.193.114.81\":1554022102,\"40.77.167.219\":1554329191,\"207.46.13.177\":1554445847,\"157.55.39.140\":1556644534,\"207.46.13.20\":1554488308,\"95.163.255.14\":1554510076,\"157.55.39.134\":1554552411,\"136.243.17.161\":1554621605,\"95.163.255.16\":1554646583,\"66.249.79.191\":1555450799,\"66.249.79.189\":1556436125,\"109.252.93.99\":1554915023,\"95.220.54.186\":1555182841,\"207.46.13.212\":1555271217,\"51.75.13.156\":1555297299,\"46.229.168.152\":1596483724,\"157.55.39.231\":1555571635,\"66.249.69.43\":1555792757,\"54.36.148.249\":1654171544,\"207.46.13.125\":1555889980,\"40.77.167.100\":1635474025,\"62.210.202.81\":1557398864,\"37.17.172.132\":1556415209,\"81.209.177.136\":1556